import { Container } from 'react-bootstrap'
import './entry.style.css'
const Entry = () => {
  return (
    <div className='entry-page bg-info'>
      <Container className="p-5 w-25 mb-4 bg-light rounded-3">
        <h1>asfgh</h1>
      </Container>
    </div>
  )
}

export default Entry
